 * - Supply: 10,000,000,000 (10 Billion)
 * - Decimals: 18
 * - Burnable: Yes
 * - Mintable: No (Fixed Supply)
 */
contract NeuralyToken is ERC20, ERC20Burnable, Ownable {
    constructor(address initialOwner) ERC20("Neuraly", "NEURALY") Ownable(initialOwner) {
